import React, { useEffect, useState } from "react";
import './Table.css';


function App(){

const[data,setData]=useState("")

useEffect(()=>{
fetch("http://localhost:3006/StudenInfo")
.then(res=>res.json())
.then(resp=>setData(resp))
.catch(err=>err)
},[])

return(
    <div>
        <h1>Student Info</h1>
        <table>
            <thead>
                <tr>
                    <th>Id</th>
                    <th>RollNo</th>
                    <th>Name</th>
                    <th>City</th>
                    <th>Dept</th>
                </tr>
            </thead>
            <tbody>
            {data?.map((item)=>(
                <tr>
                   
                    <td>{item.id}</td>
                    <td>{item.rollNo}</td>
                    <td>{item.name}</td>
                    <td>{item.city}</td>
                    <td>{item.dept}</td>
                </tr>
                ))}
            </tbody>
        </table>
    </div>
)
}
export default App;
